import moment from "moment";
import { useState } from "react";
function Clock(){

    const [time, setTime] = useState(moment().format('LT'))

    setInterval(
        setTime(moment().format('LT'))
    , 5000)

    return(
        <span>
            {time}
        </span>
    );
}

export default Clock;
